// store.dispatch(startAddPlacement({ name: 'Anonymous', description:'Round-1. Coding Round (Pretty easy, cakewalk. There were 2 questions of \'Very easy\' difficulty level. For MCQs you must be good at the basics of DBMS, DSA, Coding and OS) 2) Group Discussion (Initiate the discussion and conclude it well. Maintain eye contact) 3) Technical interview (Be strong with basics of DBMS and DSA. Confidence is the key). 4) Manager round (You have to manipulate the interviewer well and convince him/her that you are well suited for the job, that\'s all) 5) HR round (Confidence is the key again. Convince him somehow.)', companyName: 'Societe Generale', packages: '13.12 CTC ', cgpa: '8.71', branch: 'CSE', noOfRounds: '5', individualDescription: ['1) Coding Round (Pretty easy, cakewalk. There were 2 questions of \'Very easy\' difficulty level. For MCQs you must be good at the basics of DBMS, DSA, Coding and OS)', '2) Group Discussion (Initiate the discussion and conclude it well. Maintain eye contact)', '3) Technical interview (Be strong with basics of DBMS and DSA. Confidence is the key).', '4) Manager round (You have to manipulate the interviewer well and convince him/her that you are well suited for the job, that\'s all)', '5) HR round (Confidence is the key again. Convince him somehow.)','','','','',''], preparation: 'Geeksforgeeks companywise preparation.', date: '08-02-2019', advice: 'Be confident and come prepared. Utilize the time you have during your Summer break before placements.'})) 
// store.dispatch(startAddPlacement({ name: 'Ashish', description:'Round-1. Cpp coding round, Round-2. Build a basic paging program in C in 6 hours, Round-3. Technical interview, Round-4. HR interview', companyName: 'Commvault', packages: 'CTC 20 lpa Base pay 11.5 lpa', cgpa: '9.01', branch: 'CSE with Bioinformatics', noOfRounds: '4', individualDescription: ['1 Cpp coding round','2 Build a basic paging program in C in 6 hours','3 technical interview','4 HR interview','','','','','',''], preparation: 'GFG, Youtube for Networking and OS lectures', date: '08-13-2019', advice: 'This company doesn\'t ask any DSA related questions, it\'s more about memory management and stuff.'}))
// store.dispatch(startAddPlacement({ name: 'Anonymous', description:'Round 1. It was an online round consisting of 3 sections, aptitude, technical and coding. It was conducted on mettl. Coding questions were of easy level difficulty. 2 coding questions were asked. Technical questions were focused mostly around SQL and DBMS. Aptitude questions were easy as well. The test duration was 1.5 hours. Technical and coding sections were interchangeable however aptitude wasn\'t. ', companyName: 'Shell', packages: '12.38', cgpa: '8.97', branch: 'Computer Science', noOfRounds: '2', individualDescription: ['Round 1 1st round was an online round consisting of 3 sections, aptitude, technical and coding. It was conducted on mettl. Coding questions were of easy level difficulty. 2 coding questions were asked. Technical questions were focused mostly around SQL and DBMS. Aptitude questions were easy as well. The test duration was 1.5 hours. Technical and coding sections were interchangeable however aptitude wasn\'t.','Round 2 2nd round was a Skype interview. It was a mixture of technical as well as managerial and HR.','','','','','','','',''], preparation: ' Be prepared with your resume and basic concepts from OOPS, DBMS as well as all the languages you have mentioned in your resume. Also, be prepared  to face some situation based questions during your interview. They test you based on the star approach- situation, task, action, result. Try to orient your answers in this direction.', date: '08-08-2019', advice: 'Solve questions on data structures and algorithms. Don\'t be scared of coding, it is not as tough as we think it is. Coding 2 problems a day right from the start of first year can land you at a great job offer. Study OS, DBMS, DSA and networks with complete diligence and make sure to understand all the concepts thoroughly. KnowledgeGate channel on YouTube is helpful. Hackerrank and GeeksForGeeks are good platforms to practice coding. Make sure to have aptitude on mark, so solve some apti-based questions from time to time. Make sure to have 2-3 good projects and a solid internship reflect on your resume. All the best!'}))
// store.dispatch(startAddPlacement({ name: 'Jishu Dohare', description:'Round-1. It was an online test which had 2 coding questions and few MCQ\'s, this round was not that difficult( I first ensured that I run both the coding questions first and then do the MCQ\'s quickly If I know any)', companyName: 'Amazon', packages: '30 CTC(approx) and 13 base(approx)+benefits', cgpa: '8.5', branch: 'CSE', noOfRounds: '4', individualDescription: ['1 - Round was an online test which had 2 coding questions and few MCQ\'s, this round was not that difficult( I first ensured that I run both the coding questions first and then do the MCQ\'s quickly If I know any)','2 - Group Fly round(or elimination round), in this round all the 70-80 shortlisted were given the same question. One question was a BST based question and other was based on DFS in a matrix(both were somewhat okay for this round).','3 - Interview round 1, in this round the interviewee asked me two questions. One was based on BST to merge two BST with minimal Time and space complexity. Initially, I gave multiple basic solutions which were not that optimal.  Then I gave my final solution in which I almost used this approach (https://www.geeksforgeeks.org/merge-two-bsts-with-limited-extra-space/), but since I have not used GeeksForGeeks much for placement prep. I used competitive programming tricks to give a solution which was almost similar to this one. (wrote the entire code for this with the dry run of corner cases, even though my solution was not Point-Perfect in case of complexity, but was giving a Balanced BST at the end, so the trade-off was good enough.) I specifically told him that for querying the tree this is most optimal(since it is a balanced tree). The second was based on Trie, he asked me to decompose the database into a certain data structure such that using the same data structure return the product which is has been sold the most or viewed the most i.e. on the basis of parameters we can easily modify it. So I suggested Tries and told him that at the end of each path of Trie, we can store info and sort the data-structure on the basis of the end-value(any value like Sold Count, Viewed, Reviewed). Like (try to understand) for each node it\'s subnodes will be in a vector or array, and when the values will be returned we will return the max value for each path and on the basis of that we can sort vector for each and every node, and we do it for each insertion, so retrieving info will be optimal(the interviewee seemed happy with my solution). And then he told me that sometimes amazon database tables have like more than 1000 or infinite attributes in a table, and he told me that he wants to create a Primary key for a table, what approach should be used. This question was somewhat vague, so I just told him what hit my mind at that moment, I told him that we can use any two or more columns and perform salting and hashing on the values, that way will get a unique hash. He asked what should we take for hashing I told him values like company name like "Cadbury", name of the product "Silk-Fruit-and-Nut" and the quantity "500gm", this will most probably give unique hash every time and we can make a primary key out of it. He was somewhat convinced then he asked me about the Complexity of Hash-Algorithm which will be used, I didn\'t know about that, I told him that I will use MD5 or SHA256 for it. He then asked that you know the algorithms, why don\'t you know the complexity, then I realised I have dug my own grave because he told me to write out the algorithm or pseudo code for it and then we\'ll analyse the complexity. I took the pen but went blank ( I was disappointed in myself). Even though, I took a deep breath then bluntly told him that \"Sir, I have only used this algorithm while doing web development. I used to store the password of the user in the database. I have used built-in functions for such operations.\". After this, the interviewee looked at me and made a face as I have admitted that I am not a worthy candidate. He then further asked me which language did you use it in. I told him that I used it in PHP and  Python, and also told him that it is available in almost every language and people always use the in-built functions for encryption because the actual code is very long and complex.','4 - Firstly I would like to say that I was amazed that I was even called for this round and I was called immediately after my 3rd round. This interview went absolutely perfect, I was asked one question of Binary Search which was to find the missing AP element from the array(this is quite easy if you take your time). I wrote the code for this. The other question was given an N-ary Tree, for each query "K" was given and you have to print the K-th parent for each and every node in each query. The question was tricky, initially, I gave a solution using DSU, the solution was fine but was not optimal because if K is large then for each node we have to make K-jumps which is not good( I also told the interviewee that path compression is also useless in this case and he agreed.). Then I took my time and gave a solution using DFS+Array), so I will easily return the Kth element from the end of the array and that will be the Kth parent for that node. But the space complexity was not good in case of Skeweed Tree. Then I took some time and gave a solution which was using DFS+Cache(Dequeue as Data Structure for Cache). The size of the Cache was K because, during DFS, I was deleting elements from back if Cache size exceeded K, and during return to the parent node, to visiting the adjacent child nodes. I was again adding the parent node. (Try to understand this by writing on paper, and you\'ll get it). I wrote the code for it and the interviewee was really happy with my answer, he also said \"Good, great solution\". And then asked me about Deadlock and conditions of it. I explained what a deadlock is but failed to list the conditions, then OOPS concept Inheritance specifically Up-Casting and Down-Casting, I was somewhat able to explain him.','','','','','',''], preparation: 'I never prepared specifically for placement purpose, I have been doing CP for the past 1.5 years and very Seriously for like past 3-4 months. If you have time then sign-up on Codechef, HackerEarth, Hackerrank etc.. and start Coding for real.', date: '07-26-2019', advice: 'Don\'t be a dork, try to excel in more than one field if you have time. You can apply principles of one field in other and vice-versa and really enjoy the journey. Aur 9 pointer ban Jao to majje hai.'}))
// store.dispatch(startAddPlacement({ name: 'A.S.', description:'1 Coding Round - 3 Questions 2 medium + 1 Hard', companyName: 'LYNK LOGISTICS', packages: '10 lakhs Fixed', cgpa: '8.61', branch: 'Computer Science and Engineering', noOfRounds: '3', individualDescription: ['1 Coding Round - 3 Questions 2 medium + 1 Hard','','','','','','','','',''], preparation: 'GeeksforGeeks , CodingNinja (Interview Preparation Kit) Course.', date: '08-22-2019', advice: 'Coding Ninja Interview Preparation Course is must if you can shell out 7k RS. Some Questions directly come from discussed problems in Course. Start Coding from mid of 6th onwards. I started late  15-20 days before VIT. Missed Chance on slot 1 companies. For Hard Questions GFG must free resource. For Super Dream Companies advance Data Structures like Trees are must. For Dynamic Programming you should to strong with Recursion.'}))
