// store.dispatch(startAddPlacement({ name: 'Kaushal Agarwal', description:'Round-1. Online Test It consisted of 2 Problem Solving (on Dynamic Programming), SQL Queries & OS MCQs. It was conducted on InterviewBit. Round-2. Technical Interview 1. Round-3. Technical Interview 2. Round-4. Technical Interview 3', companyName: 'OYO Rooms', packages: '10.5 CTC', cgpa: '8.85', branch: 'Computer Science', noOfRounds: '4', individualDescription: ['1. Online Test It consisted of 2 Problem Solving (on Dynamic Programming), SQL Queries & OS MCQs. It was conducted on InterviewBit.','2. Technical Interview 1','3. Technical Interview 2','4. Technical Interview 3 There was problem-solving questions on Arrays, Strings, Linked List, Trees, Graphs, Hash Map, Dynamic Programming. Some questions were on DBMS and OS. Overall it was a great experience. The most important part of these interviews is to speak out loud your thought process. And finally, provide optimal solutions.','','','','','',''], preparation: 'My preparation wasn\'t company specific. But yes you can find my plan here, https://github.com/agarwalkaushal/Placement-Prep. Hit the star, to increase it\'s reach.', date: '08-17-2019', advice: 'Be yourself. Don\'t feel disheartened if you don\'t clear an interview. Think of it as an experience. Don\'t lie on your resume (I guarantee recruiters will know). And finally, challenge yourself at every step.'}))
