// store.dispatch(startAddPlacement({ name: 'Anshul Sachdev', description:'Round-1. Online Round contained aptitude questions and two easy coding questions. First question was to reverse a string with some constraints. Second question was related to array manipulation. Round-2. Group Discussion', companyName: 'Societe Generale', packages: 'CTC- 13.13', cgpa: '9.27', branch: 'Computer Science', noOfRounds: '6', individualDescription: ['Round-1. Online Round contained aptitude questions and two easy coding questions.','First question was to reverse a string with some constraints.','Second question was related to array manipulation.','Round-2. Group Discussion','Round-3,4,5. Three technical interviews. Most of the questions were asked from my resume which included my projects, internship and a task to use one of my  technical domain in a banking application. Also, he asked me to write a code for linear and binary search. More questions were like why JAVA and not C++, my favourite subject(s) and some questions related to them.','Round-6. HR Round','','','',''], preparation: 'Not did any company specific preparation. I did coding practice on HackerRank and GeeksForGeeks. Aptitude question on IndiaBix. Operating System on YouTube channel-KnowledgeGate and DBMS from TutorialsPoint video lectures.', date: '08-03-2019', advice: 'Be confident. Be well prepared with company\'s background. Do more and more questions of Dynamic Programming as most of the companies focus on this topic.'}))
