// store.dispatch(startAddPlacement({ name: 'Anonymous', description:'First round was online test in which around 130 students were shortlisted based on CGPA.This test contained 3 sections.First section was MCQ\'s on verbal reasoning,second section consisted of MCQ\'s based on logical and analytical skills and third section contained 2 coding questions.My first two sections went good and in third section one code ran with all the test cases.I was shortlisted for the next round.', companyName: 'Wells Fargo', packages: 'CTC-20 lakhs , Base pay-14 lakhs', cgpa: '9.13', branch: 'Computer Science', noOfRounds: '4', individualDescription: ['First round was online test in which around 130 students were shortlisted based on CGPA.This test contained 3 sections.','First section was MCQ\'s on verbal reasoning,second section consisted of MCQ\'s based on logical and analytical skills and third section contained 2 coding questions.','My first two sections went good and in third section one code ran with all the test cases.I was shortlisted for the next round.','Second round was technical written round.It was of 1.5 hrs and we were given a question paper to solve.It consisted of puzzles,logical and mental ability questions,technical questions and 2 coding questions. After this I was shortlisted for the next round.','Third round was technical interview.There was one person per candidate to take the interview.Questions were resume were asked.I was asked about all the project in depth and had to explain them thoroughly.They asked all the related stuff related the concept used in the project.Then they asked questions on core subjects like Data Structures and Algorithms,Operating systems,Database Management System and OOP\'s.Questions on programming languages C++,JAVA and python were also asked.System design questions were also asked.After this I was shortlisted for the last round.','Last round was Technical + HR round.One person from technical department and other one HR was taking the interview.It started with first HR question -"How are u feeling right now?" and then there were loads of technical questions from the technical guy.He asked about the projects mentioned in my resume,questions on Operating systems,Database management system etc.Also he asked me which was my favorite subject except Data structures and algorithms and DBMS.I told Image processing so he asked me questions on that.After that the HR asked me that what percentage I am sure that I would be selected in the company or not.I gave a diplomatic answer which impressed him I guess.And then he asked me that what I do in my free time and do I think that I can become a leader or not.The interview well went so I hoped that I would be selected and then finally I was selected and I was very happy.','','','',''], preparation: 'I practiced coding from geeksforgeeks and hackerank.I read the core subjects like Operating systems,DBMS and DSA from the notes which I made during the course when I was studying in college and brushed through all the important concepts of these subjects.I practiced aptitude from indiabix.com.', date: '07-28-2019', advice: 'I would like to say that practice coding as coding is crucial to get into a good company and also be thorough with the core subjects like OS,DBMS,DSA and network as questions from these subjects will only be asked in the interviews.And also do your coding as well as technical theory part because both are important to get into a good company,one is not enough.And aptitude should also be good with good communication skills. At last I would like to  say that never lose hope and patience and give your best and you will achieve you want one day definitely. All the best!!'}))
// store.dispatch(startAddPlacement({ name: 'Anonymous', description:'I got selected by codevita coding contest, so 1st round is say coding round, selected if at least 1 code is successfully completed. 2nd and 3rd round are at TCS Chennai office. 2nd round is ninja panel and if you qualify then next round digital panel. Ninja is easy to crack digital is tough yet I got through them', companyName: 'TCS Digital', packages: 'CTC 7, base no idea yet(probably 5.5 to 6.5)', cgpa: '8.26', branch: 'Comp. sc.', noOfRounds: '3', individualDescription: ['I got selected by codevita coding contest.','So 1st round is say coding round, selected if at least 1 code is successfully completed.','2nd and 3rd round are at TCS Chennai office. 2nd round is ninja panel and if you qualify then next round digital panel. Ninja is easy to crack digital is tough yet I got through them','','','','','','',''], preparation: 'Coding skills, project history in 3 years and internship work, mentioned in resume  is most important to focus on.', date: '07-17-2019', advice: 'Be frank and energetic yet not anxious'}))
// store.dispatch(startAddPlacement({ name: 'Suyash Gupta', description:'Round 1:Online test comprising of all the core cse subjects mcqs and two medium level coding questions Round 2: technical interview of 50 min (describe your projects and skills in detail) Round 3: HR round', companyName: 'Barclays', packages: '8+', cgpa: '8.65', branch: 'CSE', noOfRounds: '3', individualDescription: ['Round 1:Online test comprising of all the core cse subjects mcqs and two medium level coding questions','Round 2: technical interview of 50 min (describe your projects and skills in detail)','Round 3: HR round','','','','','','',''], preparation: 'Geeksforgeeks is more than enough. Just go through dbms, data structures, algorithms and last minute and interview questions category of above fields', date: '08-29-2019', advice: 'Know your projects in and out and make sure to be responsive to their each and every question during the HR interview. Always carry a power bank and some food because the interview day can be as long as 12-14 hrs. Your past life experiences will surely help you answer tricky questions during HR interview. So be prepared with some real or imaginary story to go through the HR. Be ready to take up any job location. And prepare yourself well before the placements start.'}))
// store.dispatch(startAddPlacement({ name: 'Harsh', description:'1st Round- Aptitude 2nd Round- Coding 3rd Round- GD 4th Round- Interview(technical+hr)', companyName: 'Caterpillar', packages: '9.8LPA', cgpa: '8.63', branch: 'CSE', noOfRounds: '4', individualDescription: ['1st - Aptitude','2nd - Coding','3rd - GD','4th - Interview(technical+hr)','','','','','',''], preparation: 'For coding round u can prefer - Geeks for Geeks and sanfoundry for MCQ For GD - Try to communicate as much as possible For interviews go through your CV and projects thoroughly ', date: '08-12-2019', advice: 'Dnt panic even if you are not able to clear the first round, it was my first time when i cleared my first round i made the best out of it, you just need one chance get it and make the best out of it'}))
