firebase.auth().onAuthStateChanged((user) => {
  if (user) {
    // console.log(firebase.auth().currentUser.photoURL);
    store.dispatch(login(user.uid));
    // renderApp();
    setTimeout(() => {
      renderApp();
    }, 2300)
    // if new user comes then only the below line should run
    database.ref(`users/`)
        .once('value')
        .then((snapshot) => {
            const users = [];
            const usersList = [];

            snapshot.forEach((childSnapshot) => {
              users.push({
                  id: childSnapshot.key,
                  ...childSnapshot.val()
                });
            });
            for (var i = 0, len = users.length; i < len; i++) {
              usersList.push(users[i].id);
            }
            // console.log(usersList);
            // this.setState((prevState) => {
            //     return{
            //         unlockList: unlockedPaperList
            //     };            
            // });
            if(!usersList.includes(user.uid)){
              database.ref(`users/${user.uid}/`).update({ coins:30 });
              // console.log('new user!');
            }
        });
    // console.log(history);
    if (history.location.pathname === '/') {
      history.push('/placements');
    }
  } else {
    store.dispatch(logout());
    // renderApp();
    setTimeout(() => {
      renderApp();
    }, 2300)
    history.push('/');
  }
});
